import {NavLink, useParams} from "react-router-dom";
import {useEffect, useState} from "react";
import {ISwitch} from "../../core/models";
import {FLOOR_IDS_COLLECTION, floorsMock, switchesMock} from "../../core/mocks/dormMock";


export const SwitchDetails = () => {
    const [switchItem, setSwitchItem] = useState<ISwitch | undefined>();
    const { switchId } = useParams();
    useEffect(() => {
        if (switchId) {
            const foundedSwitch = switchesMock[switchId] || floorsMock[FLOOR_IDS_COLLECTION.CENTRAL];
            setSwitchItem(foundedSwitch);
        }
    }, [switchId])
    return <>
        IP {switchItem?.addr_ipv4}
        <NavLink to='../terminal' state={{ addr_ipv4: switchItem?.addr_ipv4 }}>Navigate to Terminal</NavLink>
    </>
}
